import React from 'react';
//import Button from './Button';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  return (
    <div>
      <div>
        <Link to='/play/ghost'>
          <button primary >
            Race Ghost
          </button>
        </Link>
      </div>
      <div>
        <button secondary >
          Training
        </button>
      </div>
    </div>
  );
};

export default Dashboard;
